  function add() {
    setInf(0);
  }

  useEffect = () => {
    console.log(inf);
  }

  return (
      <Container>
        <h1 style={{textAlign: "center", margin: "2pc"}}> Search films </h1>
        <button onClick={setInf}/>
        <FilmsContainer data={inf}/>
      </Container>
    )
}

export default Search;
